import styled from 'styled-components'

const Outer = styled.footer`
    background-color: orange;

    position: fixed;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 5%;

    ul {
        text-align: center;
        padding-top: 5px;
        margin-top: 20px;
        margin-right: 25px;
    }

    li {
        margin: 5px 10px 5px 0px;   
        display: inline;
    }

    a {
        font-size: 20px;
    }
`
export default Outer
